class MultiPolygonKmlModel {
  List<List<List<List<double>>>> coordinates;
  String content = '';

  MultiPolygonKmlModel({required this.coordinates});

  factory MultiPolygonKmlModel.fromJson(Map<String, dynamic> json) {
    List<dynamic> coordinatesJson = json['coordinates'];
    List<List<List<List<double>>>> coordinates = coordinatesJson
        .map((item) => (item as List)
            .map((subItem) => (subItem as List)
                .map((point) => (point as List)
                    .map((coord) => (coord as num).toDouble())
                    .toList())
                .toList())
            .toList())
        .toList();

    return MultiPolygonKmlModel(coordinates: coordinates);
  }

